import React from "react";

function add(a,b){
    return a+b;
}
function sub(a,b){
    return a-b;
}
function mul(a,b){
    return a*b;
}
function div(a,b){
    return a/b;
}
// export default add;
// export{sub,mul,div};
function ret(){
    return(<>
        <ul>
            <li>the sum of two numbers is {add(40,4)}</li>
            <br></br>
            <li>the subtraction of two numbers is {sub(30,3)}</li>
            <br />
            <li>the multiplication of two numbers is {mul(10,3)}</li>
            <br />
            <li>the division of two numbers is {div(10,3)}</li>
        </ul>
        </>);
}
export default ret;
